import React from 'react';
import './Modal.css';

const Modal = (props) => {
    return (
        <Modal show onHide={handleClose}>
            <Modal.Header closeButton>
                <Modal.Title>{props.title}</Modal.Title>
            </Modal.Header>
            <Modal.Body>{props.content}</Modal.Body>
        </Modal>
        
    );


}

export default Modal;
